import React from "react";
import "date-fns";
import {
  Paper,
  Box,
  Typography,
  Divider,
  Container,
  InputLabel,
  Select,
  FormControl,
  FormHelperText,
  MenuItem,
  Grid,
  Button,
} from "@material-ui/core";

import { ThemeProvider } from "@material-ui/core/styles";
import { theme } from "../../theme/light";
import { withStyles } from "@material-ui/core/styles";
import DateFnsUtils from "@date-io/date-fns";
import {
  MuiPickersUtilsProvider,
  KeyboardTimePicker,
  KeyboardDatePicker,
} from "@material-ui/pickers";

const useStyles = (theme) => ({
  root: {
    "& > *": {},
  },
  paper: {
    width: "100%",
  },

  formControl: {
    minWidth: 300,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
});
class Home extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      age: "",
      startDate: new Date(),
      endDate: new Date() + 1,
    };
  }

  handleChange = (event) => {
    this.setState({
      age: event.target.value,
    });
  };

  handleDateChange = (date) => {
    this.setState({
      startDate: date,
      endDate: date + 1,
    });
  };
  handleEndDateChange = (date) => {
    this.setState({
      endDate: date,
    });
  };
  render() {
    const { classes } = this.props;
    const { age, startDate, endDate } = this.state;
    return (
      <ThemeProvider theme={theme}>
        <Box className="container" p={2.5} bgcolor="primary.lightBgContainer">
          <Paper className="content lead-page">
            <Box className="page-heading" mb={3}>
              <Box color="text.secondary" pt={3} pr={2.7} pb={1.8} pl={3}>
                <Typography variant="h6" gutterBottom color="inherit">
                  Dashboard
                </Typography>
              </Box>
              <Divider />
            </Box>
            <MuiPickersUtilsProvider utils={DateFnsUtils}>
              <Grid container justifyContent="space-evenly">
                <FormControl variant="standard" className={classes.formControl}>
                  <InputLabel htmlFor="age-native-simple">Age</InputLabel>
                  <Select
                    native
                    value={age}
                    placeholder={"Age"}
                    onChange={(e) => this.handleChange(e)}
                  >
                    <option aria-label="None" value="0" />
                    <option value={10}>Ten</option>
                    <option value={20}>Twenty</option>
                    <option value={30}>Thirty</option>
                  </Select>
                </FormControl>

                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="dd/MM/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="Start Date"
                  value={startDate}
                  onChange={(date) => this.handleDateChange(date)}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
                <KeyboardDatePicker
                  disableToolbar
                  variant="inline"
                  format="dd/MM/yyyy"
                  margin="normal"
                  id="date-picker-inline"
                  label="End Date"
                  minDate={startDate}
                  value={endDate}
                  onChange={(date) => this.handleEndDateChange(date)}
                  KeyboardButtonProps={{
                    "aria-label": "change date",
                  }}
                />
                <div className={classes.root}>
                  <Button variant="contained" size="small" color="primary">
                    Primary
                  </Button>
                </div>
              </Grid>
            </MuiPickersUtilsProvider>
          </Paper>
        </Box>
      </ThemeProvider>
    );
  }
}

export default withStyles(useStyles)(Home);
